import React, { Component } from "react";
import {
  TextField,
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
} from "@material-ui/core";

export class Login extends Component {
  render() {
    return (
      <div>
        <Grid
          className="mt-2"
          container
          spacing={3}
          justify="center"
          alignItems="center"
        >
          <Grid item xs={6}>
            <Card className="mt-2">
              <CardContent>
                <Typography variant="h4" align="center">
                  Login
                </Typography>

                <TextField
                  id="outlined-full-width"
                  label="Email"
                  style={{ marginTop: 5, padding: 12 }}
                  placeholder="Email Address"
                  fullWidth
                  margin="normal"
                  InputLabelProps={{
                    shrink: true,
                  }}
                  variant="outlined"
                />

                <TextField
                  id="outlined-full-width"
                  label="Password"
                  style={{ marginTop: 5, padding: 12 }}
                  placeholder="Password"
                  fullWidth
                  margin="normal"
                  InputLabelProps={{
                    shrink: true,
                  }}
                  variant="outlined"
                />

                <Button variant="contained" color="primary" align="center">
                  Primary
                </Button>
              </CardContent>
            </Card>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default Login;
